import React, { useRef, useState } from 'react'
import { Link } from "react-router-dom"
import logo from "../assets/logo.png"
import useWindowDimensions from '../getWindow'
function Navbar() {
    const {middle_search,set_middle_search}=useState({
        "display":"block"
    });
    console.log(middle_search);
    
    const {end_search,set_end_search}=useState({
        "display":"none"
    });
    var {height,width}=useWindowDimensions();
    window.addEventListener("resize",()=>{
        if(window.innerWidth<1200){
            {
                set_middle_search({"display":"none"})
                set_end_search({
                    "display":"block"
                })
            }
        }
        else{
            set_middle_search({
                "display":"block"
            })
            set_end_search({
                "display":"none"
            })
            
        }
    })
    
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid">
                    <Link className="navbar-brand ms-2" to="/">
                        <img src={logo} height="70px"></img>
                    </Link>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0 ms-5">
                            <li className="nav-item">
                                <Link className="nav-link active" aria-current="page" to="/">Home</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/">Link</Link>
                            </li>
                            <form className="d-flex" id='search-bar' style={middle_search}>
                                <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"></input>
                                <button className="btn btn-outline-success" type="submit">Search</button>
                            </form>
                            <li className="nav-item dropdown">
                                <Link className="nav-link dropdown-toggle" to="/" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                                    Dropdown
                                </Link>
                                <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                                    <li><Link className="dropdown-item" to="/">Action</Link></li>
                                    <li><Link className="dropdown-item" to="/">Another action</Link></li>
                                    <li><hr className="dropdown-divider"></hr></li>
                                    <li><Link className="dropdown-item" to="/">Something else here</Link></li>
                                </ul>
                            </li>
                        </ul>
                        <form className="d-flex" id='search-bar' style={end_search}>
                                <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"></input>
                                <button className="btn btn-outline-success" type="submit">Search</button>
                            </form>
                    </div>
                </div>
            </nav>
        </div>
    )
}

export default Navbar
